"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Step 3.</span>  Substituting the values for &quot;F&quot; and &quot;A&quot; into the formula  = 18F(âˆšA ) and calculate the construction factor (C). <span style=\" font-size:7pt; font-weight:600; font-style:italic;\">On this software either enter F and A or Direct C will work both way.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Step 4.</span>  Round the construction factor (C) to the nearest 250 gpm.</p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Step 5.</span>  Determine the predominant occupancy type and the associated factor (O).</p>\n"
