"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Step 7.</span> If there is communication with adjacent buildings, determine communication factor by identifying the combustibility of the passageway, whether the passageway is open or enclosed, the length, and a description of any protection provided in the passageway openings. The factor related to the communications between buildings is (P).</p>\n"
